	(237,'American Career College-Ontario','Ontario','CA','Visually distinctive and environmentally sound, the American Career College Ontario Campus is a source of pride for students, faculty, and associates. The college campus is a 64,000-square-foot facility that features modern classrooms, open meeting spaces, and well-equipped laboratoriesincluding a technologically advanced simulation center, skills labs, and more. The resulting campus space is a facility with interactive and purposeful learning environments that enrich the everyday campus experience. The facility is readily accessible for handicapped students. In addition to ample parking spaces, it is conveniently located near public transportation and has easy freeway access.',0.03,38015,1483,1.1,1092,0,'americancareercollege.edu/','https://media.glassdoor.com/l/53/01/8c/5f/acc-ontario.jpg'),
